create table tblInventoryConditions (
	condition_id SERIAL PRIMARY KEY,
	condition VARCHAR(25)
);


create table tblOrder (
	order_id SERIAL PRIMARY KEY,
	customer_id INTEGER REFERENCES tblCustomer(customer_id),
	date_time integer
);
-- insert into tblOrder (customer_id, date_time) values (1000, 1510661015);


CREATE TABLE tblPaymentMethod (
    payment_method_id   SERIAL PRIMARY KEY,
    payment_method      VARCHAR(25)
);




create table tblProducts (
	product_id SERIAL PRIMARY KEY,
	isbn CHAR(11),
	product_name VARCHAR(100),
	author VARCHAR(30),
	genre VARCHAR(20),
	publisher VARCHAR(20),
	product_type INTEGER,
	price DECIMAL(12,2),
	description VARCHAR(200)
);



create table tblInventory (
	inventory_id SERIAL PRIMARY KEY,
	product_id INTEGER REFERENCES tblProducts(product_id),
	inventory_condition INTEGER REFERENCES tblInventoryConditions(condition_id),
	amount INTEGER,
	notes VARCHAR(250)
);


create table tblTransaction (
	transaction_id SERIAL PRIMARY KEY,
	customer_id INTEGER REFERENCES tblCustomer(customer_id),
	order_id INTEGER REFERENCES tblOrder(order_id),
	payment_method INT REFERENCES tblPaymentMethod(payment_method_id),
	amount_paid DECIMAL(12,2)
);


create table jncOrderItems
(
    order_id INTEGER REFERENCES tblOrder(order_id),
    inventory_id INTEGER REFERENCES tblInventory(inventory_id),
    quantity INTEGER
);

